window.bookSummaryJSON = "<p>I'm not what everyone thinks I am.</p> <p>If they discover my hidden origin, both the gods and demons will hunt me to the ends of the universe.</p> <p>But I don't carry my dark secret alone. The sea demigod, my sworn enemy, now carries it with me and leaves a trail of dead bodies behind to keep me - and my secret - safe.</p> <p>Then the God of War returns to the Academy. Obsessed with my uniqueness, he steals me from his son's bed to make me warm his.</p> <p>So war breaks out between the war god and my demigods.</p> <p>If we survive the brutal battle, my mates will soon learn the truth about me is dirtier than reality.</p> <p>Contains mature themes.</p>"; 
